import { hitArea } from "./hitArea.mjs";
const virtualTouchableRules = {
  transform: "translateY(-50%)",
  minHeight: hitArea,
  minWidth: hitArea,
  height: "100%",
  top: "50%"
};
export {
  virtualTouchableRules
};
